    rl.question('Please enter your age: ', (age: string) => {
        // Convert the age input to a number
        const userAge = Number(age);

        // Check if the age is valid
        if (isNaN(userAge) || userAge < 18) {
            console.log('Invalid age. Please enter a valid age.');
            return;
        }

        // Create a UserInput object
        const userInput: UserInput = {
            name,
            age: userAge
        };

        // Do something with the user input
        console.log(`Hello, ${userInput.name}! You are ${userInput.age} years old.`);

        // Close the readline interface
        rl.close();
    });
